import api from './authService';

// Mock eBay data generator
const generateMockEbayItems = (count = 20, searchTerm = '') => {
  const categories = ['Electronics', 'Fashion', 'Home & Garden', 'Sports', 'Collectibles', 'Automotive'];
  const conditions = ['New', 'Used', 'Refurbished', 'For Parts'];
  const locations = ['New York, NY', 'Los Angeles, CA', 'Chicago, IL', 'Houston, TX', 'Phoenix, AZ'];
  
  return Array.from({ length: count }, (_, i) => {
    const category = categories[Math.floor(Math.random() * categories.length)];
    const condition = conditions[Math.floor(Math.random() * conditions.length)];
    const location = locations[Math.floor(Math.random() * locations.length)];
    const currentBid = Math.floor(Math.random() * 1000) + 50;
    const timeRemaining = Math.floor(Math.random() * 600) + 60; // 1-10 minutes
    
    return {
      id: `ebay_${Date.now()}_${i}`,
      title: searchTerm ? `${searchTerm} - ${category} Item ${i + 1}` : `${category} Item ${i + 1} - ${condition}`,
      description: `High-quality ${category.toLowerCase()} item in ${condition.toLowerCase()} condition. Perfect for collectors and enthusiasts.`,
      currentBid,
      startingPrice: Math.floor(currentBid * 0.6),
      timeRemaining,
      image: `https://picsum.photos/400/300?random=${i}`,
      category: category.toLowerCase(),
      condition: condition.toLowerCase(),
      dealPotential: Math.floor(Math.random() * 40) + 60, // 60-100
      competitionLevel: ['low', 'medium', 'high'][Math.floor(Math.random() * 3)],
      trendingScore: Math.floor(Math.random() * 30) + 70, // 70-100
      platform: 'eBay',
      bidCount: Math.floor(Math.random() * 20) + 1,
      seller: {
        username: `seller_${Math.floor(Math.random() * 1000)}`,
        profileImage: `https://i.pravatar.cc/40?img=${i}`,
        rating: (Math.random() * 2 + 3).toFixed(1) // 3.0-5.0
      },
      location,
      itemUrl: `https://ebay.com/itm/${Date.now()}_${i}`,
      aiScore: {
        dealPotential: Math.floor(Math.random() * 40) + 60,
        competitionLevel: ['low', 'medium', 'high'][Math.floor(Math.random() * 3)],
        trendingScore: Math.floor(Math.random() * 30) + 70
      }
    };
  });
};

export const ebayService = {
  // Search eBay items (using mock data for now)
  async searchItems(searchParams = {}) {
    const {
      keywords = '',
      categoryId = '',
      minPrice = '',
      maxPrice = '',
      condition = '',
      sortOrder = 'EndTimeSoonest',
      page = 1,
      limit = 20
    } = searchParams;

    // Simulate API delay
    await new Promise(resolve => setTimeout(resolve, 500));
    
    const items = generateMockEbayItems(limit, keywords);
    
    return {
      items,
      pagination: {
        current: page,
        pages: Math.ceil(100 / limit), // Mock total pages
        total: 100,
        limit,
        hasNextPage: page < Math.ceil(100 / limit)
      }
    };
  },

  // Get item details by eBay item ID (using mock data for now)
  async getItemDetails(itemId) {
    // Simulate API delay
    await new Promise(resolve => setTimeout(resolve, 300));
    
    const items = generateMockEbayItems(1);
    const item = items[0];
    item.id = itemId;
    
    // Add bidding history
    item.bids = Array.from({ length: Math.floor(Math.random() * 10) + 1 }, (_, i) => ({
      bidder: `bidder_${i + 1}`,
      amount: item.startingPrice + (i * 10),
      timestamp: new Date(Date.now() - (i * 60000)) // Each bid 1 minute apart
    }));
    
    return item;
  },

  // Get trending eBay items (using mock data for now)
  async getTrendingItems(category = 'all', limit = 20) {
    // Simulate API delay
    await new Promise(resolve => setTimeout(resolve, 400));
    
    const items = generateMockEbayItems(limit);
    // Make trending items have higher trending scores
    items.forEach(item => {
      item.aiScore.trendingScore = Math.floor(Math.random() * 20) + 80; // 80-100
    });
    
    return {
      items,
      categories: [
        { _id: 'electronics', count: 45 },
        { _id: 'fashion', count: 32 },
        { _id: 'home', count: 28 },
        { _id: 'sports', count: 21 },
        { _id: 'collectibles', count: 18 }
      ]
    };
  },

  // Get ending soon items (auctions ending in next 10 minutes)
  async getEndingSoonItems(limit = 20) {
    // Simulate API delay
    await new Promise(resolve => setTimeout(resolve, 400));
    
    const items = generateMockEbayItems(limit);
    // Make items ending soon have shorter time remaining
    items.forEach(item => {
      item.timeRemaining = Math.floor(Math.random() * 300) + 30; // 30 seconds to 5 minutes
    });
    
    return { items };
  },

  // Get best deals (high deal potential items)
  async getBestDeals(limit = 20) {
    // Simulate API delay
    await new Promise(resolve => setTimeout(resolve, 400));
    
    const items = generateMockEbayItems(limit);
    // Make best deals have higher deal potential
    items.forEach(item => {
      item.aiScore.dealPotential = Math.floor(Math.random() * 20) + 80; // 80-100
    });
    
    return { items };
  },

  // Get categories (using mock data for now)
