    // Simulate API delay
    await new Promise(resolve => setTimeout(resolve, 200));
    
    const categories = [
      { id: 'electronics', name: 'Electronics', count: 1250 },
      { id: 'fashion', name: 'Fashion', count: 890 },
      { id: 'home', name: 'Home & Garden', count: 650 },
      { id: 'sports', name: 'Sports', count: 420 },
      { id: 'collectibles', name: 'Collectibles', count: 380 },
      { id: 'automotive', name: 'Automotive', count: 290 }
    ];
    
    return { categories };
  },

  // Get seller information
  async getSellerInfo(sellerUsername) {
    const response = await api.get(`/ebay/seller/${sellerUsername}`);
    return response.data;
  },

  // Get similar items
  async getSimilarItems(itemId, limit = 10) {
    const response = await api.get(`/ebay/similar/${itemId}`, {
      params: { limit }
    });
    return response.data;
  },

  // Get item history (bidding history for auctions)
  async getItemHistory(itemId) {
    const response = await api.get(`/ebay/item/${itemId}/history`);
    return response.data;
  },

  // Get watchlist
  async getWatchlist() {
    const response = await api.get('/ebay/watchlist');
    return response.data;
  },

  // Add item to watchlist
  async addToWatchlist(itemId) {
    const response = await api.post('/ebay/watchlist', { itemId });
    return response.data;
  },

  // Remove item from watchlist
  async removeFromWatchlist(itemId) {
    const response = await api.delete(`/ebay/watchlist/${itemId}`);
    return response.data;
  },

  // Get saved searches
  async getSavedSearches() {
    const response = await api.get('/ebay/saved-searches');
    return response.data;
  },

  // Create saved search
  async createSavedSearch(searchData) {
    const response = await api.post('/ebay/saved-searches', searchData);
    return response.data;
  },

  // Update saved search
  async updateSavedSearch(searchId, searchData) {
    const response = await api.put(`/ebay/saved-searches/${searchId}`, searchData);
    return response.data;
  },

  // Delete saved search
  async deleteSavedSearch(searchId) {
    const response = await api.delete(`/ebay/saved-searches/${searchId}`);
    return response.data;
  },

  // Get item recommendations based on user behavior
  async getRecommendations(limit = 20) {
    const response = await api.get('/ebay/recommendations', {
      params: { limit }
    });
    return response.data;
  },

  // Get price history for an item
  async getPriceHistory(itemId) {
    const response = await api.get(`/ebay/item/${itemId}/price-history`);
    return response.data;
  },

  // Get market insights for a category or keyword
  async getMarketInsights(keyword, categoryId = null) {
    const params = { keyword };
    if (categoryId) params.categoryId = categoryId;
    
    const response = await api.get('/ebay/market-insights', { params });
    return response.data;
  }
};

export default ebayService;
